  - &ProcessingLevelID00003 {ProcessingLevelCode:  "2", Definition:  "Derived products", Explanation:  "Derived products that require scientific and technical interpretation and may include multiple-sensor data. An example is basin average precipitation derived from rain gages using an interpolation procedure."}
  - &ProcessingLevelID00004 {ProcessingLevelCode:  "3", Definition:  "Interpreted products", Explanation:  "Interpreted products that require researcher driven analysis and interpretation, model-based interpretation using other data and/or strong prior assumptions. An example is basin average precipitation derived from the combination of rain gages and radar return data."}
  - &ProcessingLevelID00005 {ProcessingLevelCode:  "4", Definition:  "Knowledge products", Explanation:  "Knowledge products that require researcher driven scientific interpretation and multidisciplinary data integration and include model-based interpretation using other data and/or strong prior assumptions. An example is percentages of old or new water in a hydrograph inferred from an isotope analysis."}
